import React from 'react';

/**
 * Component responsible for rendering the video player components.
 */
export default class Loading extends React.Component {
	state = {

	}

	componentDidMount() {

	}

	render() {
		const { template } = this.props;

		return (
			<div className='loading'>
				loading {template}
			</div>
		)
	}
}
